import { useState } from "react";
import $ from "jquery";
import "../App.css";
const Registration = () => {

function RegistrationFunc() {
    const [firstname, setFirstname] = useState("");
    const [lastname, setLastname] = useState("");
    const [mail, setMail] = useState("");
    const [age, setAge] = useState("");
    const [result, setResult] = useState("");

    const handleChangeFirstname = (e) => {
        setFirstname(e.target.value);

    };
    const handleChangeLastname = (e) => {
      setLastname(e.target.value);
     };
    const handleChangeMail = (e) => {
      setMail(e.target.value);
    };
    const handleChangeAge = (e) => {
      setAge(e.target.value);
    };

    const handleSumbit = (e) => {
        e.preventDefault();
        const form = $(e.target);
        $.ajax({
            type: "POST",
            url: form.attr("action"),
            data: form.serialize(),
            success(data) {
                setResult(data);
            },
        });
    };

    return (

        <div className="App">
            <h1>Registration</h1>
            <div className="registrationContainer">
            <form
                className="registrationForm"
                action="http://localhost:8000/server.php"
                method="post"
                onSubmit={(event) => handleSumbit(event)}
            >
                <label htmlFor="firstname">First name: </label>
                <input type="text" id="firstname" name="firstname" value={firstname} onChange={(event) => handleChangeFirstname(event)} />
                <br/>
                <label htmlFor="lastname">Last name: </label>
                <input type="text" id="lastname" name="lastname" value={lastname} onChange={(event) => handleChangeLastname(event)} />
                <br />
                <label htmlFor="mail">E-mail: </label>
                <input type="text" id="mail" name="mail" value={mail} onChange={(event) => handleChangeMail(event)} />
                <br />
                <label htmlFor="age">Age: </label>
                <input type="text" id="age" name="age" value={age} onChange={(event) => handleChangeAge(event)} />
                <br />
                <button type="submit">Submit</button>
            </form>
            </div>
            <h1>{result}</h1>
        </div>
    );
}
return RegistrationFunc();
};

export default Registration;
